		<div className='tc bg-black dib br3 pa3 ma2 grow bw2 shadow-5'>
			<img alt='robots' src={"https://robohash.org/size=200x200"}/>
			<div className='user'>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	)
}

export default Card;
